import { useState } from "react";
import { BASE_URL } from "../App";
import { Modal, Button, Form } from "react-bootstrap";
import { toast, ToastContainer } from "react-toastify";
import 'react-toastify/dist/ReactToastify.css';

const CreateUserModal = ({ setUsers }) => {
	const [isOpen, setIsOpen] = useState(false);
	const [isLoading, setIsLoading] = useState(false);
	const [inputs, setInputs] = useState({
		name: "",
		gradYear: "",
		email: "",
		linkedin: "",
	});

	const handleCreateUser = async (e) => {
		e.preventDefault();
		setIsLoading(true);
		try {
			const res = await fetch(BASE_URL + "/members", {
				method: "POST",
				headers: {
					"Content-Type": "application/json",
				},
				body: JSON.stringify(inputs),
			});

			const data = await res.json();
			if (!res.ok) {
				throw new Error(data.error);
			}

			toast.success("You are a member!", {
				position: "top-center",
				autoClose: 2000,
				hideProgressBar: false,
				closeOnClick: true,
				pauseOnHover: true,
				draggable: true,
				progress: undefined,
			});
			setIsOpen(false);
			setUsers((prevUsers) => [...prevUsers, data]);

			setInputs({
				name: "",
				gradYear: "",
				email: "",
				linkedin: "",
			}); // clear inputs
		} catch (error) {
			toast.error(`An error occurred: ${error.message}`, {
				position: "top-center",
				autoClose: 4000,
				hideProgressBar: false,
				closeOnClick: true,
				pauseOnHover: true,
				draggable: true,
				progress: undefined,
			});
		} finally {
			setIsLoading(false);
		}
	};

	const handleClose = () => setIsOpen(false);
	const handleShow = () => setIsOpen(true);

	return (
		<>
			<Button variant="primary" onClick={handleShow}>
				Submit!
			</Button>

			<Modal show={isOpen} onHide={handleClose}>
				<Modal.Header closeButton>
					<Modal.Title>Join Our Club</Modal.Title>
				</Modal.Header>
				<Form onSubmit={handleCreateUser}>
					<Modal.Body>
						{/* Name Input */}
						<Form.Group controlId="name">
							<Form.Label>Full Name</Form.Label>
							<Form.Control
								type="text"
								placeholder="John Doe"
								value={inputs.name}
								onChange={(e) => setInputs({ ...inputs, name: e.target.value })}
								required
							/>
						</Form.Group>

						{/* College Graduate Year Input */}
						<Form.Group controlId="gradYear" className="mt-3">
							<Form.Label>College Graduate Year</Form.Label>
							<Form.Control
								type="number"
								placeholder="2024"
								value={inputs.gradYear}
								onChange={(e) => setInputs({ ...inputs, gradYear: e.target.value })}
								required
							/>
						</Form.Group>

						{/* Email Input */}
						<Form.Group controlId="email" className="mt-3">
							<Form.Label>Email</Form.Label>
							<Form.Control
								type="email"
								placeholder="johndoe@example.com"
								value={inputs.email}
								onChange={(e) => setInputs({ ...inputs, email: e.target.value })}
								required
							/>
						</Form.Group>

						{/* LinkedIn Input */}
						<Form.Group controlId="linkedin" className="mt-3">
							<Form.Label>LinkedIn</Form.Label>
							<Form.Control
								type="url"
								placeholder="https://linkedin.com/in/johndoe"
								value={inputs.linkedin}
								onChange={(e) => setInputs({ ...inputs, linkedin: e.target.value })}
								required
							/>
						</Form.Group>
					</Modal.Body>

					<Modal.Footer>
						<Button variant="secondary" onClick={handleClose}>
							Cancel
						</Button>
						<Button variant="primary" type="submit" disabled={isLoading}>
							{isLoading ? "Adding..." : "Add"}
						</Button>
					</Modal.Footer>
				</Form>
			</Modal>

			{/* ToastContainer to show notifications */}
			<ToastContainer />
		</>
	);
};

export default CreateUserModal;
